import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import { data } from "../helpers/data";
import PlayerCard from "./PlayerCard";

const CardContainer = () => {
	return (
  <Container className="card-container">
    <Row>
      {data.map((player) => (
        <Col xl={3}>
        <PlayerCard {...player}/>
      </Col>
    
    ))}
    </Row>
    
    </Container>
  ) 
};

export default CardContainer;
